import React from "react";
import styled from "styled-components";
import Navbar from "../components/Navbar";

const Home = () => {
  return (
    <Container>
      <Navbar />
      <Wrapper>
        <Left>
          <Title>Achieve Mastery Through Challenge</Title>
          <Into>
            Improve your development skills by training with your peers on
            assessments that include code kata, quizzes and prose that
            continuously challenge and push your coding practice
          </Into>
          <Button> Sign up & code</Button>
        </Left>
        <Right>right</Right>
      </Wrapper>
    </Container>
  );
};

export default Home;

const Container = styled.main``;

const Wrapper = styled.section`
  padding: 3.75rem;
  display: flex;
  align-items: center;
`;

const Left = styled.article`
  flex: 1;
`;

const Title = styled.h1`
  font-weight: bold;
  font-size: 5.3rem;
  letter-spacing: 1px;
  margin-bottom: 2rem;
  color: #ea501a;
`;

const Into = styled.p`
  color: #101f3c;
  font-size: 2rem;
  line-height: 1.5;
  margin-bottom: 2rem;
`;

const Button = styled.button`
  padding: 10px 1rem;
  font-weight: 600;
  color: gray;
  border: none;
  cursor: pointer;
  background-color: transparent;
`;

const Right = styled.article`
  flex: 1;
`;
